import React from 'react';
import 'antd/dist/antd.css';
import { Form, Input, Button, Checkbox, Space} from 'antd';


export default class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      value: null,
    };
  }

   layout = {
    labelCol: {
      span: 8,
    },
    wrapperCol: {
      span: 16,
    },
  };
   tailLayout = {
    wrapperCol: {
      offset: 8,
      span: 16,
    },
  };

  onFinish = (values) => {
    console.log('Success:');
  };

  onClick = () => {
    console.log('EIEI:');
  };

  onFinishFailed = (errorInfo) => {
    console.log('Failed:');
  };

  render() {
    return (
      <div style={{display:'flex', flex:1,  justifyContent:'center', alignItems:'center' ,height:'100vh',flexDirection:'column'}}>
        <div style={{color:'red',flex:0.3}}>

        </div>
        <div style={{ justifyContent:'center', alignItems:'center'}}>
          <div style={{display:'flex',flexDirection:'column',width:'100%',color:'red',height:'50%'}}>
            <Input style={{width:'100%'}}/>
            <Input.Password style={{width:'100%'}}/>
          </div>

          <div style={{justifyContent:'center', alignItems:'center' }}>
            <Button style={{width:'30%'}} type="primary" onClick={this.onClick}>
              Submit
            </Button>
            <Button style={{marginLeft:'5%',width:'30%'}} type="primary" onClick={this.onClick}>
              Reset
            </Button>
          </div>
        </div>   
    </div>
    );
  }
}
